import { Bottle } from "../bottle/Bottle";
import "./BottleList.css";

export const BottlesList = () => {
    const bottleFlex = [];
    for(let i=0;i < 6;i++) {
        bottleFlex[i] += <Bottle/> + 
        <div>
            <h3>Bottle</h3>
            <p>Bottle Description</p>
            <p>Price: <b>$310</b></p>
        </div>
    }
    return (
        <div className="flex-style">
            {bottleFlex}
        </div>
    )
}
